import React from "react";
import { Form, Col, Button, Container, Row, Card } from "react-bootstrap";
import "./Register.styles.css";

const Register = (props) => {
  return (
    <div className="register h-100 d-flex justify-content-center align-items-center">
      <Card style={{width:"150%"}}>
        <Card.Body>
          <Card.Title className="title-register">Create Account</Card.Title>
          <Form className="my-4">
            <Row md={2} sm={1} xs={1}>
              <Col className="my-2">
                <Form.Control style={{width:"150%"}} placeholder="First name" />
              </Col>
              <Col>
                <Form.Control style={{width:"150%"}} placeholder="Last name" />
              </Col>
            </Row>
          </Form>
        </Card.Body>
      </Card>
    </div>
  );
};

export default Register;
